import React from 'react'
import logo from '../assests/login.png'
function Login() {
  return (
    <div className='w-screen '>
          <img src={logo} className='w-6/12 min-h-screen float-left'/>
           <div className='w-5/12 float-right'>
              
           </div>
    </div>
  )
}

export default Login
